// Access the headersRight array
let refinedHeader = msg.ui.dataset_s[1].table.rightSide.headersRight;

// Transform each object in the headersRight array
refinedHeader = headersRight.map(header => {
    let singleValue = {};
    let complexPart = {};

    // Separate properties based on their type
    for (let key in header) {
        if (typeof header[key] === "object" && header[key] !== null) {
            // Add a 'collapse' field with initial value false for complexPart
            complexPart[key] = header[key];
        } else {
            singleValue[key] = header[key];

        }
    }
    // Return the new structure
    return {
        singleValue,
        complexPart
    };
});

// Update the modified array back to the message
msg.ui.dataset_s[1].table.rightSide.headersRight = refinedHeader;

// Return the modified message
return msg;

